AFTER INSERT ON critique
FOR EACH ROW
BEGIN
UPDATE film
SET note_moyenne = (SELECT AVG(critique.note)
FROM critique
WHERE critique.id_film = New.id_film)
WHERE film.id_film = NEW.id_film;
END */;;
